import React, { Component } from "react";
import {Link} from "react-router-dom";
import "./accueil.css";
import Data from "./data.json"

export default class Accueil extends Component{
    constructor(props){
        super(props);
    }

    render() {
        return (
        <div id="articles">
            <Link to={Data[0].id}>
                <div id="article">
                    <p id="article__title">{Data[0].title}</p>
                </div>
            </Link>
        </div>
        )
    }
}
